import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {ColumnContainer, AppContainer} from './styles/styles'

ReactDOM.render(
  <React.StrictMode>
    <AppContainer>
    <ColumnContainer> 
    I will be a great Programmer In sha Allah 
    </ColumnContainer>
    </AppContainer>
  </React.StrictMode>,
  document.getElementById('root')
);

